import React from "react";
import { Link  , ExternalLink } from "react-router-dom";
import "./FooterChild.css"

const FooterChild = ({title , array_of_child})=>{

    return(
        <div  className="FooterChild_wrapper" >
            <div className="title">
                {title} 
            </div>
            <div className="bottom">
                {array_of_child.map((val,i)=>(
                    <Link to="https://www.linkedin.com/in/hritik-sharma-05677b200/" key={i}  >{val.name}</Link>
                ))}
            </div>
        </div>
    )
}

export default FooterChild ;
